const zigbeeHerdsmanConverters = require('zigbee-herdsman-converters');
const {KeyValue, Definition, Tz, Fz, Expose, KeyValueAny, KeyValueNumberString, KeyValueString} = require('zigbee-herdsman-converters/lib/types');
const exposes = zigbeeHerdsmanConverters.exposes;
const ea = exposes.access;
const e = exposes.presets;
const fz = zigbeeHerdsmanConverters.fromZigbeeConverters;
const tz = zigbeeHerdsmanConverters.toZigbeeConverters;
const reporting = require('zigbee-herdsman-converters/lib/reporting');

const ACCESS_STATE = 0b001, ACCESS_WRITE = 0b010, ACCESS_READ = 0b100;
const ZCL_DATATYPE_UINT16 = 0x21;
const ZCL_DATATYPE_UINT32 = 0x23;

const fz_local = {
    se_metering: {
        cluster: 'seMetering',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty('currentTier1SummDelivered')) {
                result.energy_t1 = msg.data.currentTier1SummDelivered / 100;
            }
            if (msg.data.hasOwnProperty('currentTier2SummDelivered')) {
                result.energy_t2 = msg.data.currentTier2SummDelivered / 100;
            }
            if (msg.data.hasOwnProperty('currentTier3SummDelivered')) {
                result.energy_t3 = msg.data.currentTier3SummDelivered / 100;
            }
            if (msg.data.hasOwnProperty('currentTier4SummDelivered')) {
                result.energy_t4 = msg.data.currentTier4SummDelivered / 100;
            }
            if (msg.data.hasOwnProperty(0xF001)) {
                result.device_address = msg.data[0xF001];
            }
            if (msg.data.hasOwnProperty(0xF002)) {
                result.measurement_period = msg.data[0xF002];
            }
            return result;
        },
    },
};

const tz_local = {
    se_metering: {
        key: ['device_address'],
        convertSet: async (entity, key, value, meta) => {
            await entity.write('seMetering', {0XF001: {value, type: ZCL_DATATYPE_UINT32}});
            return {state: {device_address: value}};
        },    
        convertGet: async (entity, key, meta) => {
            await entity.read('seMetering', [0XF001]);
        },
        key: ['measurement_period'],
        convertSet: async (entity, key, value, meta) => {
            await entity.write('seMetering', {0XF002: {value, type: ZCL_DATATYPE_UINT16}});
            return {state: {measurement_period: value}};
        },    
        convertGet: async (entity, key, meta) => {
            await entity.read('seMetering', [0XF002]);
        },
       },
};


const device = {
    zigbeeModel: ['Mercury_Counter'],
    model: 'Mercury_Counter',
    description: 'Zigbee Mercury Counter',
    vendor: 'Bacchus',
    fromZigbee: [fz.electrical_measurement, fz_local.se_metering],
    toZigbee: [tz_local.se_metering],
    configure: async (device, coordinatorEndpoint, logger) => {
        const endpoint = device.getEndpoint(1);
        await reporting.bind(endpoint, coordinatorEndpoint, ['genBasic', 'genIdentify', 'haElectricalMeasurement', 'seMetering']);
        await reporting.readEletricalMeasurementMultiplierDivisors(endpoint);
        await endpoint.read('haElectricalMeasurement', ['acVoltageMultiplier', 'acVoltageDivisor']);
        await endpoint.read('haElectricalMeasurement', ['acCurrentMultiplier', 'acCurrentDivisor']);
        await endpoint.read('haElectricalMeasurement', ['acPowerMultiplier', 'acPowerDivisor']);
        await endpoint.read('seMetering', [0xF001]); // device_address
        await endpoint.read('seMetering', [0xF002]); // measurement_period
        await reporting.rmsVoltage(endpoint);
        await reporting.rmsCurrent(endpoint);
        await reporting.activePower(endpoint);
    },
    exposes: [
        e.power(), 
        e.current(), 
        e.voltage(),
        e.numeric('energy_t1').withUnit('kWh').withDescription('Energy on tariff 1'),
        e.numeric('energy_t2').withUnit('kWh').withDescription('Energy on tariff 2'),
        e.numeric('energy_t3').withUnit('kWh').withDescription('Energy on tariff 3'),
        e.numeric('energy_t4').withUnit('kWh').withDescription('Energy on tariff 4'),
        e.numeric('device_address', ACCESS_STATE | ACCESS_WRITE | ACCESS_READ).withDescription('Device Address'),
        e.numeric('measurement_period', ACCESS_STATE | ACCESS_WRITE | ACCESS_READ).withDescription('Measurement Period'),
    ],
icon: 'data:image/png;base64,'
};

module.exports = device;
